import { styled } from '@mui/material/styles';
import Chip from '@mui/material/Chip';
import Paper from '@mui/material/Paper';


const ListItem = styled('li')(({theme}) => ({
    margin:theme.spacing(0.5),
}));

function ListOfActivities() {
   const activities = [
    {key:0,label:'entries()'},{key:1 ,label:'every()'},{key:2 ,label:'filter()'},{key:3 ,label:'find()'},{key:4 ,label:'findIndex()'},{key:5 ,label:'findLast()'},{key:6 ,label:'flat()'},{key:7 ,label:'forEach()'},{key:8,label:'icludes()'},{key:9 ,label:'indexOf()'},{key: 10,label:'join()'},{key:11 ,label:'keys()'},{key:12 ,label:'pop()'},{key:13 ,label:'push()'},{key:14 ,label:'reduce()'},{key:15,label:'reverse()'},{key:16 ,label:'shift()'},{key:17 ,label:'unshift()'},{key:18 ,label:'values()'},{key:19 ,label:'sort()'},{key:20 ,label:'slice()'},

   ]

    return(
        <>
        <Paper
          sx={{
            display:'flex',
            justifyContent:'center',
            flexWrap:'wrap',
            listStyle:'none',
            p:'0.5',
            m:'0',
          }}
        >
        {activities.map((activity) => {
            return(
                <ListItem key={activity.key}>
                    <Chip 
                    onClick={handle}
                    variant='outlined'
                    label={activity.label}
                    />
                </ListItem>
            )
        } ) }
        </Paper>
        </>
    )
}
export default ListOfActivities;
